import React from 'react'
import TextInputField from '../../component/TextInput'

const TodoListScreen = () => {
  return (
    <div className="root">
       <div className="main-container">
          <h1 className="heading"> Todo-List </h1>

          <TextInputField/>
       </div>
    </div>
  )
}

export default TodoListScreen
